import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const WorkflowDeleteBtn = () => {
	return (
		<div>
			<span>Delete Workflow</span>
			<FontAwesomeIcon icon="trash" />
		</div>
	);
};

export default WorkflowDeleteBtn;
